import { Box } from "@mui/material";
import Grid2 from "@mui/material/Unstable_Grid2/Grid2";
import React from "react";

const ProductSummary = () => {
  return (
    <Box sx={{ width: "80%",margin:'auto'}}>
      <Grid2
        container
        direction="row"
        alignItems="center"
        xs={11}
      >
        testing
      </Grid2>
      </Box>
  );
};

export default ProductSummary;
